import React from 'react';
import { Container, Typography, List, ListItem, ListItemText, Paper } from '@mui/material';
import { useParams } from 'react-router-dom';
import Draggable from 'react-draggable';

const PreDefinedPath = ({ pathways }) => {
  const { id } = useParams();
  const steps = pathways.techPaths[id]?.steps || [];

  return (
    <Container>
      <Typography variant="h4">{pathways.techPaths[id]?.title || 'Pathway not found'}</Typography>
      <List>
        {steps.map((step, index) => (
          <Draggable key={index}>
            <div>
              <Paper elevation={3} style={{ padding: '8px', marginBottom: '8px' }}>
                <ListItem>
                  <ListItemText primary={`${index + 1}. ${step}`} />
                </ListItem>
              </Paper>
            </div>
          </Draggable>
        ))}
      </List>
    </Container>
  );
};

export default PreDefinedPath;
